import { useEffect } from "react";
import { AppBar, Box, Grid2, List } from "@mui/material";


// Styling the Navbar text
const NavbarText = styled(Typography)`
  color :white  ;
  font-family: "poppins";
  
`
const TopBar =styled(Box)`
background-color: black;
display: flex;
justify-content: center;
height: 44px;
display: none;
`


const NavbarMain=styled(Navbar)`
  display: flex;
  justify-content: center;
  align-items: center;
`

