  return (<>
    <TopBar>
      <Toolbar>
        <NavbarText >
          Summer Sale: All Swim Suits And Free Express Delivery - OFF 50%! Shop Now
        </NavbarText>
      </Toolbar>
    </TopBar>
  <AppBar>
    <Grid2 container>
      <Grid2 size={4}>
<Typography variant="h4"> Exclisive </Typography>
      </Grid2>


    </Grid2>
   
  </AppBar>
    </>
  
  );
}
